		XASSERT(gInts.EngineTrace);
		XASSERT(gInts.ModelInfo);
		XASSERT(gInts.cvar);
		XASSERT(gInts.ModelRender);
		XASSERT(gInts.EventManager);
		XASSERT(gInts.steamclient);
		XASSERT(gInts.steamfriends);
		XASSERT(gInts.steamuser);
